import statistics

def calculate_accuracy(sample_objects):
    accuracies = []
    for sample_object in sample_objects:
        total_embeddings = 0
        correct_predictions = 0
        num_keys = len(sample_object)
        for key in sample_object:
            highest_score = max(sample_object[key].values())
            same = sample_object[key][key]
            if same == highest_score:
                correct_predictions += 1
            total_embeddings += 1
        accuracy = correct_predictions / total_embeddings
        accuracies.append(accuracy)
    return accuracies

def calculate_top_k_accuracy(k, sample_objects):
    top_k_accuracies = []
    for sample_object in sample_objects:
        total_embeddings = 0
        correct_predictions = 0
        num_keys = len(sample_object)
        for key in sample_object:
            highest_scores = sorted(sample_object[key].values(), reverse=True)[:k]
            same = sample_object[key][key]
            if same in highest_scores:
                correct_predictions += 1
            total_embeddings += 1
        top_k_accuracy = correct_predictions / total_embeddings
        top_k_accuracies.append(top_k_accuracy)
    return top_k_accuracies

